import React from "react";
import Icon from "react-native-vector-icons/AntDesign";
import { Father } from "react-native-vector-icons/";
import {
  Container,
  Header,
  Title,
  BalanceContainer,
  Value,
  Bold,
  HeaderContainer,
  eyeButton,
  Info
} from "./styles";

const Wallet = () => {
  return (
    <Container>
      <Header>
        <HeaderContainer>
          <Title>Saldo PicPay</Title>

          <BalanceContainer>
            <Value>
              R$ <Bold>0,00</Bold>
            </Value>
          </BalanceContainer>

          <eyeButton>
            {/* <Father name="eye" size={28} color="#fff" /> */}
          </eyeButton>
        </HeaderContainer>
        <Info>Seu saldo está rendendo 100% do CDI</Info>
      </Header>
    </Container>
  );
};
Wallet.navigationOptions = {
  tabBarLabel: "Carteira",
  tabBarIcon: ({ tintColor }) => (
    <Icon name="creditcard" size={20} color={tintColor} />
  )
};
export default Wallet;
